                'description' => '{"en":"Science Cafes & Pub Talks is an annual gathering that serves as a platform for educators, learners, and experts to exchange knowledge, ideas, and insights in various fields of education. Through keynote speeches, panel discussions, and interactive workshops, the symposium aims to foster collaboration, innovation, and continuous learning in the education community. Whether you\'re a teacher, student, researcher, or education enthusiast, Science Cafes & Pub Talks Symposium offers opportunities to network, learn from others, and contribute to the advancement of education.","hi":"\\u0932\\u0930\\u094d\\u0928\\u0939\\u092c \\u0938\\u093f\\u092e\\u094d\\u092a\\u094b\\u091c\\u093c\\u093f\\u092f\\u092e \\u090f\\u0915 \\u0935\\u093e\\u0930\\u094d\\u0937\\u093f\\u0915 \\u0938\\u092e\\u093e\\u0917\\u092e \\u0939\\u0948 \\u091c\\u094b \\u0936\\u093f\\u0915\\u094d\\u0937\\u093e\\u0930\\u094d\\u0925\\u093f\\u092f\\u094b\\u0902, \\u0936\\u093f\\u0915\\u094d\\u0937\\u0915\\u094b\\u0902, \\u0914\\u0930 \\u0935\\u093f\\u0936\\u0947\\u0937\\u091c\\u094d\\u091e\\u094b\\u0902 \\u0915\\u094b \\u0936\\u093f\\u0915\\u094d\\u0937\\u093e \\u0915\\u0947 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0915\\u094d\\u0937\\u0947\\u0924\\u094d\\u0930\\u094b\\u0902 \\u092e\\u0947\\u0902 \\u091c\\u094d\\u091e\\u093e\\u0928, \\u0935\\u093f\\u091a\\u093e\\u0930, \\u0914\\u0930 \\u0905\\u0928\\u0941\\u092d\\u0935 \\u0915\\u093e \\u0906\\u0926\\u093e\\u0928-\\u092a\\u094d\\u0930\\u0926\\u093e\\u0928 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u090f\\u0915 \\u092e\\u0902\\u091a \\u0915\\u0947 \\u0930\\u0942\\u092a \\u092e\\u0947\\u0902 \\u0915\\u093e\\u0930\\u094d\\u092f \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964 \\u092e\\u0941\\u0916\\u094d\\u092f \\u092d\\u093e\\u0937\\u0923, \\u092a\\u0948\\u0928\\u0932 \\u091a\\u0930\\u094d\\u091a\\u093e\\u090f\\u0901, \\u0914\\u0930 \\u0907\\u0902\\u091f\\u0930\\u0948\\u0915\\u094d\\u091f