                'description' => '{"en":"Museum Tours & Exhibits is an educational event that brings together learners, educators, and experts from various fields for a dynamic and immersive learning experience. It features a diverse range of workshops, seminars, panel discussions, and hands-on activities designed to enhance knowledge, skills, and creativity. Participants have the opportunity to explore new topics, exchange ideas, and network with like-minded individuals. Museum Tours & Exhibits aims to inspire lifelong learning and foster a vibrant community of learners passionate about personal and professional development. Whether you\'re a student, professional, or lifelong learner, LearnFest offers something for everyone to ignite curiosity and spark innovation.","hi":"LearnFest \\u090f\\u0915 \\u0936\\u0948\\u0915\\u094d\\u0937\\u093f\\u0915 \\u0906\\u092f\\u094b\\u091c\\u0928 \\u0939\\u0948 \\u091c\\u094b \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0915\\u094d\\u0937\\u0947\\u0924\\u094d\\u0930\\u094b\\u0902 \\u0915\\u0947 \\u0936\\u093f\\u0915\\u094d\\u0937\\u093e\\u0930\\u094d\\u0925\\u093f\\u092f\\u094b\\u0902, \\u0936\\u093f\\u0915\\u094d\\u0937\\u0915\\u094b\\u0902, \\u0914\\u0930 \\u0935\\u093f\\u0936\\u0947\\u0937\\u091c\\u094d\\u091e\\u094b\\u0902 \\u0915\\u094b \\u090f\\u0915 \\u0917\\u0924\\u093f\\u0936\\u0940\\u0932 \\u0914\\u0930 \\u0917\\u0939\\u0930\\u0947 \\u0938\\u0940\\u0916\\u0928\\u0947 \\u0915\\u093e \\u0905\\u0928\\u0941\\u092d\\u0935 \\u092a\\u094d\\u0930\\u0926\\u093e\\u0928 \\u0915\\u0930\\u0924\\u093e \\u0939\\u0948\\u0964 \\u0907\\u0938\\u092e\\u0947\\u0902 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0935\\u0930\\u094d\\u0915\\u0936\\u0949\\u092a, \\u0938\\u0947\\u092e\\u093f\\u0928\\u093e\\u0930, \\u092a\\u0948\\u0928\\u0932 \\u091a\\u0930\\u094d\\u091a\\u093e\\u090f\\u0901, \\u0914\\u0930 \\u0939\\u093e\\u0925\\u094b\\u0902 \\u092e\\u0947\\u0902 \\u0915\\u093e\\u0930\\u094d\\u092f\\u0915\\u094d\\u0930\\u092e \\u09