                'description' => '{"en":"Workshops & Skill-building Sessions is an event where participants engage in a series of questions and answers on various topics. It challenges individuals to demonstrate their knowledge, quick thinking, and problem-solving skills within a competitive setting. Quiz competitions can cover a wide range of subjects, from general knowledge and trivia to specific academic disciplines. They provide an entertaining and educational platform for participants to test their understanding and learn new information in a fun and interactive way.","hi":"\\u0915\\u094d\\u0935\\u093f\\u091c\\u093c \\u092a\\u094d\\u0930\\u0924\\u093f\\u092f\\u094b\\u0917\\u093f\\u0924\\u093e \\u090f\\u0915 \\u0910\\u0938\\u0940 \\u0918\\u091f\\u0928\\u093e \\u0939\\u094b\\u0924\\u0940 \\u0939\\u0948 \\u091c\\u0939\\u093e\\u0902 \\u092a\\u094d\\u0930\\u0924\\u093f\\u092d\\u093e\\u0917\\u0940 \\u0935\\u093f\\u092d\\u093f\\u0928\\u094d\\u0928 \\u0935\\u093f\\u0937\\u092f\\u094b\\u0902 \\u092a\\u0930 \\u092a\\u094d\\u0930\\u0936\\u094d\\u0928\\u094b\\u0924\\u094d\\u0924\\u0930\\u0940 \\u092e\\u0947\\u0902 \\u0936\\u093e\\u092e\\u093f\\u0932 \\u0939\\u094b\\u0924\\u0947 \\u0939\\u0948\\u0902\\u0964 \\u092f\\u0939 \\u0935\\u094d\\u092f\\u0915\\u094d\\u0924\\u093f\\u092f\\u094b\\u0902 \\u0915\\u094b \\u0909\\u0928\\u0915\\u0947 \\u091c\\u094d\\u091e\\u093e\\u0928, \\u0924\\u0947\\u091c \\u0938\\u094b\\u091a\\u0928\\u0947, \\u0914\\u0930 \\u0938\\u092e\\u0938\\u094d\\u092f\\u093e \\u0938\\u092e\\u093e\\u0927\\u093e\\u0928 \\u0915\\u0947 \\u0915\\u094c\\u0936\\u0932 \\u0915\\u093e \\u092a\\u094d\\u0930\\u0926\\u0930\\u094d\\u0936\\u0928 \\u0915\\u0930\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u092a\\u094d\\u0930\\u0924\\u093f\\u0938\\u094d\\u092a\\u0930\\u094d\\u0927\\u0940 \\u092a\\u0930\\u093f\\u0938\\u0930 \\u092e\\u0947\\u0902 \\u0909\\u0924\\u094d\\u0924\\u0947\\u091c\\u093f\\u0924 \\u0915\\u0930\\u0924\\u0940 \\u0939\\u0948\\u0964 \\u0915\\u094d\\u0935