                'description' => '{"en":"Academic Competitions & Tournaments is an annual event dedicated to fostering innovation and collaboration in the field of neuroscience and cognitive sciences. It brings together researchers, professionals, and enthusiasts to explore the latest advancements, exchange ideas, and discuss emerging trends in brain research and cognitive enhancement. Through keynote speeches, panel discussions, and interactive workshops, Academic Competitions & Tournaments aims to inspire creativity, facilitate knowledge sharing, and drive forward-thinking solutions to complex challenges in neuroscience.","hi":"\\u092c\\u094d\\u0930\\u0947\\u0928\\u092c\\u0942\\u0938\\u094d\\u091f \\u0915\\u0949\\u0928\\u094d\\u092b\\u093c\\u094d\\u0930\\u0947\\u0902\\u0938 \\u090f\\u0915 \\u0935\\u093e\\u0930\\u094d\\u0937\\u093f\\u0915 \\u0906\\u092f\\u094b\\u091c\\u0928 \\u0939\\u0948 \\u091c\\u094b \\u092e\\u0938\\u094d\\u0924\\u093f\\u0937\\u094d\\u0915 \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u0914\\u0930 \\u092e\\u093e\\u0928\\u0938\\u093f\\u0915 \\u0935\\u093f\\u091c\\u094d\\u091e\\u093e\\u0928 \\u0915\\u0947 \\u0915\\u094d\\u0937\\u0947\\u0924\\u094d\\u0930 \\u092e\\u0947\\u0902 \\u0928\\u0935\\u093e\\u091a\\u093e\\u0930 \\u0914\\u0930 \\u0938\\u0939\\u092f\\u094b\\u0917 \\u0915\\u094b \\u092c\\u0922\\u093c\\u093e\\u0935\\u093e \\u0926\\u0947\\u0928\\u0947 \\u0915\\u0947 \\u0932\\u093f\\u090f \\u0938\\u092e\\u0930\\u094d\\u092a\\u093f\\u0924 \\u0939\\u0948\\u0964 \\u092f\\u0939 \\u0905\\u0928\\u0941\\u0938\\u0902\\u0927\\u093e\\u0928\\u0915\\u0930\\u094d\\u0924\\u093e\\u0913\\u0902, \\u092a\\u0947\\u0936\\u0947\\u0935\\u0930\\u094b\\u0902, \\u0914\\u0930 \\u0909\\u0924\\u094d\\u0938\\u093e\\u0939\\u093f\\u0924\\u094b\\u0902 \\u0915\\u094b \\u090f\\u0915\\u0924\\u094d\\u0930 \\u0932\\u093e\\u0924\\u093e \\u0939\\u0948 \\u0924\\u093e\\u0915\\u093f \\u0935\\u0947 \\u0928\\u0935\\u0940\\u0928\\u0924\\u092e \\u0909\\u0928\\u094d\\u0928\\u0924\\u093f